var Arrays=function(a){this.array=a;this.len=this.array.length;};Arrays.prototype={get:function(){return this.array;},swap:function(d,a){var c=this.array[d];
this.array[d]=this.array[a];this.array[a]=c;},bubbleSort:function(){for(var a=1;a<this.len;a++){for(var b=0;b<this.len-a;b++){if(this.array[b+1]<=this.array[b]){this.swap(b,b+1);
}}}},selectSort:function(){for(var b=0;b<this.len;b++){var a=this.array[0],d=0;for(var c=1;c<this.len-b;c++){if(this.array[c]>=a){a=this.array[c];d=c;}}this.swap(d,c-1);
}},insertSort:function(){for(var b=1;b<this.len;b++){var a=this.array[b];var c=b-1;while(c<this.len&&this.array[c+1]>a){c--;}this.array[c+1]=a;}},};